import React from "react";
import PropTypes from "prop-types";
import { Hero } from "../../ui-components";
import { Box } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

function Home(props) {
  return (
    <div>
      <Hero />
      <Box></Box>
    </div>
  );
}

Home.propTypes = {};

export default Home;
